// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IMedicalData {
    function updateVitals(uint _bloodPressure) external; 
    function getPatientData(address _patientAddress)
        external
        view
        returns (
            string memory bloodGroup,
            string memory medicalHistory,
            string memory title,
            string memory description,
            string memory date,
            string memory BP,
            string memory Chol 
        );
}

contract MockOracle {
    address public medicalDataContract;

    constructor(address _medicalDataContract) {
        medicalDataContract = _medicalDataContract;
    }

    function fetchAndSendVitals(address _patientAddress) external {
        require(_patientAddress != address(0), "Invalid patient address");
        uint simulatedBloodPressure = getSimulatedBloodPressure();
        IMedicalData(medicalDataContract).updateVitals(simulatedBloodPressure);
        emit VitalsUpdated(_patientAddress, simulatedBloodPressure);
    }

    function getSimulatedBloodPressure() internal pure returns (uint) {
        return 120; // Example blood pressure
    }

    event VitalsUpdated(address indexed patientAddress, uint256 bloodPressure);
}
